import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "../styles/ProfileEdit.css";

const ProfileEdit = () => {
    const navigate = useNavigate();
    const [profile, setProfile] = useState({
        instruments: "",
        genres: "",
        influences: "",
        city: "",
        experience: "",
        youtubeLink: "",
        instaLink: "",
        bio: "",
    });

    useEffect(() => {
        const getProfile = async () => {
            try {
                const token = localStorage.getItem("token");
                const response = await axios.get("http://localhost:5000/api/profile", {
                    headers: { Authorization: `Bearer ${token}` },
                });

                setProfile({
                    instruments: response.data.instruments?.join(", ") || "",
                    genres: response.data.genres?.join(", ") || "",
                    influences: response.data.influences?.join(", ") || "",
                    city: response.data.city || "",
                    experience: response.data.experience || "",
                    youtubeLink: response.data.socialLinks?.youtube || "",
                    instaLink: response.data.socialLinks?.instagram || "",
                    bio: response.data.bio || "",
                });
            } catch (error) {
                console.log("Profile not found or error fetching data.");
            }
        };

        getProfile();
    }, []);

    const handleUpdate = async () => {
        try {
            const token = localStorage.getItem("token");
            await axios.post(
                "http://localhost:5000/api/profile",
                {
                    instruments: profile.instruments.split(", "),
                    genres: profile.genres.split(", "),
                    influences: profile.influences.split(", "),
                    city: profile.city,
                    experience: profile.experience,
                    socialLinks: {
                        youtube: profile.youtubeLink,
                        instagram: profile.instaLink,
                    },
                    bio: profile.bio,
                },
                { headers: { Authorization: `Bearer ${token}` } }
            );

            alert("Profile updated successfully");
            navigate("/profile");
        } catch (error) {
            alert("Error updating profile. Try again.");
        }
    };

    return (
        <div className="profile-edit-container">
            <h2 className="profile-edit-title">EDIT PROFILE</h2>

            <div className="profile-edit-form">
                <label>Instruments:</label>
                <input
                    type="text"
                    value={profile.instruments}
                    onChange={(e) => setProfile({ ...profile, instruments: e.target.value })}
                />

                <label>Genres:</label>
                <input
                    type="text"
                    value={profile.genres}
                    onChange={(e) => setProfile({ ...profile, genres: e.target.value })}
                />

                <label>Years of Experience:</label>
                <input
                    type="number"
                    value={profile.experience}
                    onChange={(e) => setProfile({ ...profile, experience: e.target.value })}
                />

                <label>Influences:</label>
                <input
                    type="text"
                    value={profile.influences}
                    onChange={(e) => setProfile({ ...profile, influences: e.target.value })}
                />

                <label>City:</label>
                <input
                    type="text"
                    value={profile.city}
                    onChange={(e) => setProfile({ ...profile, city: e.target.value })}
                />

                <label>Social Media (Instagram):</label>
                <input
                    type="text"
                    value={profile.instaLink}
                    onChange={(e) => setProfile({ ...profile, instaLink: e.target.value })}
                />

                <label>Bio:</label>
                <textarea
                    value={profile.bio}
                    onChange={(e) => setProfile({ ...profile, bio: e.target.value })}
                />

                <button className="profile-edit-btn" onClick={handleUpdate}>
                    Update My Profile
                </button>
            </div>
        </div>
    );
};

export default ProfileEdit;
